import { Page, TextStyle } from '@shopify/polaris';

const Index = () => (
    <div>
      <Page
        primaryAction={{
          content: 'Select products',
        }}
      >
        <TextStyle variation="positive">
          Sample app using React and Next.js
        </TextStyle>
      </Page>
    </div>
  );

  export default Index;
